import React from "react";
import Paper from "@material-ui/core/Paper";
import {
  ArgumentAxis,
  ValueAxis,
  Chart,
  LineSeries,
} from "@devexpress/dx-react-chart-material-ui";

const LineChart = () => {
  const data = [
    { x: 0, y: 20 },
    { x: 1, y: 30 },
    { x: 2, y: 40 },
    { x: 3, y: 40 },
    { x: 4, y: 30 },
    // { x: 5, y: 20 },
    // { x: 6, y: 60 },
    // { x: 7, y: 40 },
    // { x: 8, y: 40 },
    // { x: 9, y: 80 },
  ];
  return (
    <div><span><b>Statistics</b>&nbsp;<i>&nbsp;Bookings</i>&nbsp;<i>&nbsp;Earnings</i></span>
     <Paper className="chart">
         <Chart data={data}>
         <ArgumentAxis/>
         <ValueAxis/>
         <LineSeries valueField="y" argumentField="x"/>
         </Chart>
     </Paper>
    </div>
  );
};

export default LineChart;
